        // </Card>



        <MDBCard style={{ maxWidth: '22rem' }}>
      <MDBRipple rippleColor='light' rippleTag='div' className='bg-image hover-overlay'>
        <MDBCardImage src={playerData.strCategoryThumb} fluid alt='...' />
        <a>
          <div className='mask' style={{ backgroundColor: 'rgba(251, 251, 251, 0.15)' }}></div>
        </a>
      </MDBRipple>
      <MDBCardBody>
        <MDBCardTitle>{playerData.strCategory}</MDBCardTitle>
        <MDBCardText>
           ₹{playerData.strPrice}
        </MDBCardText>
        <MDBBtn href='#'onClick={() => addInCart(playerData)}>ADD TO CART</MDBBtn>
      </MDBCardBody>
    </MDBCard>

    )
}

export default Items;
